/*Table structure for table `InviteBallAA` */

DROP TABLE IF EXISTS `InviteBallAA`;

CREATE TABLE `InviteBallAA` (
  `ID` char(32) NOT NULL COMMENT 'ID-约球AA付款',
  `Create_time` datetime DEFAULT NULL COMMENT '创建时间',
  `Invite_ball_id` varchar(32) NOT NULL COMMENT '约球ID',
  `Amount_sum` decimal(11,2) DEFAULT NULL COMMENT '总共预收',
  `Amount_fee` decimal(11,2) DEFAULT NULL COMMENT '平台费用',
  `Amount_out` decimal(11,2) DEFAULT NULL COMMENT '总支出金额',
  `Ought_member_refund` decimal(11,2) DEFAULT NULL COMMENT '应退总额',
  `Real_member_refund` decimal(11,2) DEFAULT NULL COMMENT '实退总额',
  `Member_refund` decimal(11,2) DEFAULT NULL COMMENT '每人退费',
  `Content` varchar(100) DEFAULT NULL COMMENT '退费备注',
  `Repair_flag` int(11) NOT NULL DEFAULT '0' COMMENT '是否是补录',
  `Repair_amount` decimal(11,2) DEFAULT NULL COMMENT '补录金额',
  `Deal_time` datetime DEFAULT NULL COMMENT '充值成功时间',
  `Deal_flag` int(1) DEFAULT NULL COMMENT '补录金额充值状态(0=待支付1=支付成功2=支付失败)',
  `WXContent` varchar(2000) DEFAULT NULL COMMENT '微信回调备查',
  PRIMARY KEY (`ID`),
  UNIQUE KEY `InviteBallId_UNIQUE` (`Invite_ball_id`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8 COMMENT='约球AA费用表';

