/*Table structure for table `InviteImage` */

DROP TABLE IF EXISTS `InviteImage`;

CREATE TABLE `InviteImage` (
  `ID` varchar(32) NOT NULL COMMENT 'ID-约球图',
  `Create_time` datetime NOT NULL COMMENT '创建时间',
  `Invite_id` varchar(32) NOT NULL COMMENT '约球ID',
  `Url` varchar(300) NOT NULL COMMENT '图片地址',
  `Head_image` int(1) DEFAULT NULL COMMENT '是否是封面图0=否1=是',
  PRIMARY KEY (`ID`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8 COMMENT='约球图片表';

