/*Table structure for table `NewsBanner` */

DROP TABLE IF EXISTS `NewsBanner`;

CREATE TABLE `NewsBanner` (
  `ID` char(32) NOT NULL COMMENT '运营->横幅新闻容器',
  `BannerNO` int(11) unsigned NOT NULL COMMENT '容器编号',
  `Banner` varchar(200) DEFAULT NULL COMMENT '容器位置描述',
  `ShowWay` enum('易订场') NOT NULL COMMENT '展示平台',
  `CoverPath` varchar(300) NOT NULL COMMENT '封面URL',
  `ContentPath` varchar(300) NOT NULL COMMENT '内容URL',
  `Remark` varchar(100) DEFAULT NULL COMMENT '备注',
  PRIMARY KEY (`ID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='新闻表';

