  `ID` char(32) NOT NULL COMMENT '订场-订单表',
  `OrderNO` int(11) unsigned NOT NULL AUTO_INCREMENT COMMENT '订单编号',
  `CreateTime` datetime NOT NULL COMMENT '创建时间',
  `ModifyTime` datetime NOT NULL COMMENT '修改时间',
  `OrderDate` date NOT NULL COMMENT '订单日期',
  `VenueID` varchar(32) NOT NULL COMMENT '场馆ID',
  `MemberID` varchar(32) NOT NULL COMMENT '会员ID',
  `CoachID` varchar(32) DEFAULT NULL COMMENT '教练ID',
  `CoachAmount` double(11,2) DEFAULT NULL COMMENT '教练费用',
  `Price` double(11,2) NOT NULL COMMENT '订单总金额',
  `TimeSum` double(11,1) NOT NULL COMMENT '订单总小时数',
  `Type` int(1) NOT NULL DEFAULT '0' COMMENT '订单状态(0=待支付1=已消费2=支付取消3=支付超时4=已退款5=支付成功待确认6=已支付待消费)',
  `PayType` int(1) DEFAULT NULL COMMENT '支付方式0=支付宝1=微信支付',
  `PayRemark` varchar(1000) DEFAULT NULL COMMENT '支付结果内容(仅供效验)',
  `AmountID` varchar(32) DEFAULT NULL COMMENT '提现ID',
  `AmountType` int(1) NOT NULL DEFAULT '0' COMMENT '提现状态(0=未提现1=正在提现2=已提现)',
  PRIMARY KEY (`ID`),
  KEY `OrderNO` (`OrderNO`)
) ENGINE=MyISAM AUTO_INCREMENT=176 DEFAULT CHARSET=utf8;

/*Data for the table `Order` */

