/*Table structure for table `Period` */

DROP TABLE IF EXISTS `Period`;

CREATE TABLE `Period` (
  `ID` char(32) NOT NULL COMMENT '时段',
  `VenueID` varchar(32) NOT NULL COMMENT '场馆ID',
  `FieldID` varchar(32) NOT NULL COMMENT '场地ID',
  PRIMARY KEY (`ID`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8;

/*Data for the table `Period` */

/*Table structure for table `Permission` */

DROP TABLE IF EXISTS `Permission`;

CREATE TABLE `Permission` (
  `ID` varchar(32) NOT NULL COMMENT '权限ID',
  `Title` varchar(100) DEFAULT NULL COMMENT '权限标题',
  `Content` varchar(200) NOT NULL COMMENT '权限内容',
  `Right_type1` int(1) NOT NULL DEFAULT '0' COMMENT '一级权限是否可以访问0=否1=是',
  `Right_type2` int(1) NOT NULL DEFAULT '0' COMMENT '二级权限是否可以访问0=否1=是',
  `Right_type3` int(1) NOT NULL DEFAULT '0' COMMENT '三级权限是否可以访问0=否1=是',
  `Right_type4` int(1) NOT NULL DEFAULT '0' COMMENT '四级权限是否可以访问0=否1=是',
  `Right_type5` int(1) NOT NULL DEFAULT '0' COMMENT '五级权限是否可以访问0=否1=是',
  `Right_type6` int(1) NOT NULL DEFAULT '0' COMMENT '六级权限是否可以访问0=否1=是',
  `Right_type7` int(1) NOT NULL DEFAULT '0' COMMENT '七级权限是否可以访问0=否1=是',
  `Menu_button` int(1) NOT NULL DEFAULT '1' COMMENT '0=一级菜单1=二级菜单2=页面按钮3右键按钮',
  `Menu_title` varchar(100) DEFAULT NULL COMMENT '菜单标题',
  `Menu_Url` varchar(200) DEFAULT NULL COMMENT '菜单Url',
  `Menu_icon` varchar(100) DEFAULT NULL COMMENT '一级菜单图标',
  `Parent_id` varchar(32) DEFAULT NULL COMMENT '父级ID',
  PRIMARY KEY (`ID`)
