/*Table structure for table `TrainCourse` */

DROP TABLE IF EXISTS `TrainCourse`;

CREATE TABLE `TrainCourse` (
  `ID` varchar(32) NOT NULL COMMENT 'ID',
  `Create_time` datetime DEFAULT NULL COMMENT '创建时间',
  `Modify_time` datetime DEFAULT NULL COMMENT '修改时间',
  `Train_course_no` int(11) unsigned zerofill NOT NULL AUTO_INCREMENT COMMENT '课程编号',
  `Train_team_id` varchar(32) DEFAULT NULL COMMENT '培训机构ID',
  `Train_coach_id` varchar(32) NOT NULL COMMENT '主教ID',
  `Title` varchar(100) DEFAULT NULL COMMENT '标题',
  `Head_image` varchar(1000) DEFAULT NULL COMMENT '图片封面',
  `Amount` decimal(11,2) DEFAULT NULL COMMENT '报名价格',
  `Min_age` int(11) DEFAULT NULL COMMENT '适合年龄最小',
  `Max_age` int(11) DEFAULT NULL COMMENT '适合年龄最大',
  `Suit_base` varchar(32) DEFAULT NULL COMMENT '适合基础',
  `To_teach_number` int(11) NOT NULL DEFAULT '0' COMMENT '上课人数',
  `Class_hour` int(11) NOT NULL DEFAULT '1' COMMENT '课时',
  `To_teach_time` varchar(100) DEFAULT NULL COMMENT '上课时间',
  `Class_trait` varchar(100) DEFAULT NULL COMMENT '课程亮点(用分号间隔)',
  `Pay_make` varchar(100) DEFAULT NULL COMMENT '预约信息',
  `Pay_adjust` varchar(100) DEFAULT NULL COMMENT '调课说明',
  `Pay_refund` varchar(100) DEFAULT NULL COMMENT '退款说明',
  `Pay_trial` varchar(100) DEFAULT NULL COMMENT '试课说明',
  `Train_venue_id` varchar(32) DEFAULT NULL COMMENT '教学场地ID',
  `Ball_type` int(1) NOT NULL DEFAULT '1' COMMENT '类别(1=网球2=足球3=羽毛球)',
  `Apply_people_sum` int(11) NOT NULL DEFAULT '0' COMMENT '报名人数',
  `Apply_flag` int(1) NOT NULL DEFAULT '0' COMMENT '是否允许报名(0=否1=是)',
  PRIMARY KEY (`ID`),
  KEY `Train_course_no` (`Train_course_no`)
) ENGINE=MyISAM AUTO_INCREMENT=21 DEFAULT CHARSET=utf8 COMMENT='培训课程表';

