/*Table structure for table `Venue` */

DROP TABLE IF EXISTS `Venue`;

CREATE TABLE `Venue` (
  `ID` char(32) NOT NULL COMMENT '场馆',
  `CreateTime` datetime NOT NULL COMMENT '创建时间',
  `ModifyTime` datetime DEFAULT NULL COMMENT '修改时间',
  `VenueNO` int(11) unsigned zerofill NOT NULL AUTO_INCREMENT COMMENT '球场编号',
  `Name` varchar(100) DEFAULT NULL COMMENT '场馆名',
  `Address` varchar(100) DEFAULT NULL COMMENT '地址',
  `CityID` varchar(32) DEFAULT NULL COMMENT '城市',
  `DistrictID` varchar(32) DEFAULT NULL COMMENT '区县',
  `Owner` varchar(50) DEFAULT NULL COMMENT '经营者',
  `Tel` varchar(50) DEFAULT NULL COMMENT '联系电话',
  `BallSum` int(1) DEFAULT NULL COMMENT '场地数量',
  `Image` varchar(300) DEFAULT NULL COMMENT '封面',
  `WarmReminder` varchar(100) DEFAULT NULL COMMENT '温馨提醒',
  `Member_id` varchar(32) DEFAULT NULL COMMENT '回款人',
  `Amount` double(11,2) unsigned NOT NULL DEFAULT '0.00' COMMENT '场馆总收入',
  `Balance` double(11,2) NOT NULL DEFAULT '0.00' COMMENT '剩余可提现金额',
  `FreezeAmount` double(11,2) unsigned NOT NULL DEFAULT '0.00' COMMENT '冻结金额(已预订,但未消费)',
  `OrderVerify` int(1) NOT NULL DEFAULT '1' COMMENT '订场确认(0=人工确认1=自动确认)',
  `Longitude` double DEFAULT NULL COMMENT '经度',
  `Latitude` double DEFAULT NULL COMMENT '纬度',
  `Type` int(11) NOT NULL DEFAULT '1' COMMENT '球场类型(1=网球场2=足球场3=羽毛球馆4=篮球场)',
  `Train_add_flag` int(1) NOT NULL DEFAULT '0' COMMENT '入驻状态0=空1=添加',
  `TrainTeam` varchar(32) DEFAULT NULL COMMENT '培训机构ID',
  `ShowFlag` int(1) NOT NULL DEFAULT '2' COMMENT '状态(1=正常2=屏蔽)',
  `Min_amount` double DEFAULT NULL COMMENT '最低价格培训',
  PRIMARY KEY (`ID`),
  KEY `VenueNO` (`VenueNO`)
) ENGINE=MyISAM AUTO_INCREMENT=10001400 DEFAULT CHARSET=utf8 COMMENT='场馆表';

