/*Table structure for table `VenueTemplate` */

DROP TABLE IF EXISTS `VenueTemplate`;

CREATE TABLE `VenueTemplate` (
  `ID` char(32) NOT NULL COMMENT '模板和场馆主键关联的数据为系统默认模板',
  `CreateTime` datetime NOT NULL COMMENT '创建时间',
  `ModifyTime` datetime NOT NULL COMMENT '修改时间',
  `VenueID` varchar(32) NOT NULL COMMENT '场馆ID',
  `Name` varchar(10) NOT NULL COMMENT '模板名',
  `Price` varchar(500) NOT NULL COMMENT '时段价格字符串(逗号隔开,不可预订为-1已预约为0)',
  `DefaultFlag` int(1) NOT NULL DEFAULT '0' COMMENT '是否为默认模板(0=否1=是)',
  PRIMARY KEY (`ID`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8;

