DROP TABLE IF EXISTS `WXFundflow`;

CREATE TABLE `WXFundflow` (
  `ID` char(32) NOT NULL COMMENT 'ID',
  PRIMARY KEY (`ID`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8 COMMENT='微信资金对账表';

