/*Table structure for table `WXOrder` */

DROP TABLE IF EXISTS `WXOrder`;

CREATE TABLE `WXOrder` (
  `ID` char(32) NOT NULL COMMENT 'ID',
  `Create_time` datetime NOT NULL COMMENT '创建时间',
  `Deal_time` datetime NOT NULL COMMENT '交易时间',
  `WXOrder_id` varchar(50) NOT NULL COMMENT '微信支付单号',
  `Store_order_id` varchar(50) NOT NULL COMMENT '商户订单号',
  `Deal_scene` varchar(100) DEFAULT NULL COMMENT '交易场景',
  `Deal_type` varchar(100) DEFAULT NULL COMMENT '交易状态',
  `Deal_amount` double(11,2) DEFAULT NULL COMMENT '交易金额',
  PRIMARY KEY (`ID`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8 COMMENT='微信交易订单表';

/*Data for the table `WXOrder` */

/*Table structure for table `WXRefund` */

DROP TABLE IF EXISTS `WXRefund`;

CREATE TABLE `WXRefund` (
  `ID` char(32) NOT NULL COMMENT 'ID',
  `Create_time` datetime NOT NULL COMMENT '创建时间',
  `Refund_apply_date` datetime DEFAULT NULL COMMENT '退款申请时间',
  `WXRefund_id` varchar(50) NOT NULL COMMENT '微信退款单号',
  `Store_refund_id` varchar(50) NOT NULL COMMENT '商户退款单号',
  `Refund_type` varchar(50) DEFAULT NULL COMMENT '退款状态',
  `Refund_succeed_date` datetime DEFAULT NULL COMMENT '退款成功时间',
  `Refund_amount` double(11,2) DEFAULT NULL COMMENT '退款金额(元)',
  `Cash_refund_amount` double(11,2) DEFAULT NULL COMMENT '现金券退款金额(元)',
  `WXOrder_id` varchar(50) DEFAULT NULL COMMENT '微信支付单号',
  `Store_order_id` varchar(50) DEFAULT NULL COMMENT '商户订单号',
  `Store_id` varchar(50) DEFAULT NULL COMMENT '商户号',
  `Store_son_id` varchar(50) DEFAULT NULL COMMENT '子商户号',
  `Deal_amount` double(11,2) DEFAULT NULL COMMENT '交易金额(元)',
  `Appid` varchar(50) DEFAULT NULL COMMENT 'appid',
  `Order_user` varchar(50) DEFAULT NULL COMMENT '下单用户',
  `Refund_account` varchar(50) DEFAULT NULL COMMENT '退款入账账户',
  `Refund_way` varchar(50) DEFAULT NULL COMMENT '退款方式',
  PRIMARY KEY (`ID`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8 COMMENT='微信退款交易表';

